    false,nt"url": null,nt"notes": "LIDAR data is remotely sensed high-resolution
    elevation data collected by an airborne collection platform. By positioning laser
    range finding with the use of 1 second GPS with 100hz inertial measurement unit
    corrections, Terrapoint's LIDAR instruments are able to make highly detailed geospatial
    elevation products of the ground, man-made structures and vegetation. These data
    were collected from March 29 - April 6, 2007 for Gloucester County, New Jersey.
    The project area covers 353 square miles. The LiDAR flightlines for this project
    were planned for a 50% acquisition overlap. The nominal resolution of this project
    without overlap is 1.25 m. Four returns were recorded for each pulse in addition
    to an intensity value. GPS Week Time, Intensity, Flightline and number attributes
    were provided for each LiDAR point. Data is provided as random points, in LAS v1.1
    format, classified according to the following ASPRS Class Codes: Class 1 - Non-ground
    Class 2 - Ground Class 7 - Noise Class 9 - Water",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
